(1, 'kgxosn-cxsuiv-eogzsr-nomrlx-owatzx', 1, 'Welcome To Email Subscribers', '<strong style=\"color: #990000\">What can you achieve using Email Subscribers?</strong><p>Add subscription forms on website, send HTML newsletters & automatically notify subscribers about new blog posts once it is published. You can also Import or Export subscribers from any list to Email Subscribers.</p> <strong style=\"color: #990000\">Plugin Features</strong><ol> <li>Send notification emails to subscribers when new blog posts are published.</li> <li>Subscribe form available with 3 options to setup.</li> <li>Double Opt-In and Single Opt-In support.</li> <li>Email notification to admin when a new user signs up (Optional).</li> <li>Automatic welcome email to subscriber.</li> <li>Auto add unsubscribe link in the email.</li> <li>Import/Export subscriber emails to migrate to any lists.</li> <li>Default WordPress editor to create emails.</li> </ol> <strong>Thanks & Regards,</strong><br>Admin', 2, 'Sent', '2019-06-25 08:41:28', '2019-06-25 09:01:16', '2019-06-25 08:41:28', '2019-06-25 08:41:28'),
(2, 'ivjnog-spetrw-okbsgc-aqmnrl-yxepch', 2, 'New Post Published - Hello world!', '<p>Hello {{NAME}},</p>\n<p>We have published a new blog article on our website : Hello world!</p>\n<p>You can view it from this link : <a href=\'http://localhost/seac/2019/06/25/hello-world/\' target=\'_blank\'>http://localhost/seac/2019/06/25/hello-world/</a></p>\n<p>Thanks &#038; Regards,<br />\nAdmin</p>\n<p>You received this email because in the past you have provided us your email address : {{EMAIL}} to receive notifications when new updates are posted.</p>\n', 2, 'Sent', '2019-06-25 08:41:31', '2019-06-25 09:11:28', '2019-06-25 08:41:31', '2019-06-25 08:41:31');

