(256, 'redux_option', 'a:51:{s:8:\"last_tab\";s:1:\"1\";s:8:\"opt-logo\";a:9:{s:3:\"url\";s:53:\"https://s.wordpress.org/style/images/codeispoetry.png\";s:2:\"id\";s:0:\"\";s:6:\"height\";s:0:\"\";s:5:\"width\";s:0:\"\";s:9:\"thumbnail\";s:0:\"\";s:5:\"title\";s:0:\"\";s:7:\"caption\";s:0:\"\";s:3:\"alt\";s:0:\"\";s:11:\"description\";s:0:\"\";}s:14:\"opt-hero-title\";s:28:\"Contextualized Solutions(CS)\";s:13:\"opt-hero-text\";s:64:\" Leading innovation by design. Driving performance by execution.\";s:15:\"opt-whyus-title\";s:44:\"Why SEACs<br />\r\nContextualized Solutions\";s:14:\"opt-whyus-text\";s:1008:\"<blockquote>Our contextualized solutions instill a learning ecosystem that is tailored to the needs of your organization. Each SEAC service delivers a tangible and lasting impact to both people and the business systems they live in. We help you rethink what is possible for your organization, working alongside you to improve your leadership and innovation capabilities to revitalize your execution performance.\r\n\r\n&nbsp;</blockquote>\r\n\r\n\r\n<blockquote>\r\nMoving beyond mere theories and tools, SEAC facilitates possible solutions to specific problems, while fostering a project-based learning system. We achieve these goals by applying leading global practices that are contextualized to fit your specific context, culture and business model. within a Thai and ASEAN context.</blockquote>\r\n\r\n\r\n\r\n&nbsp;\r\n\r\n\r\n\r\n<blockquote>Through our robust organizational development framework for leadership, innovation, and execution your business will remain sustainable and competitive for years to come.</blockquote>\r\n\r\n\";s:15:\"opt-whyus-image\";a:9:{s:3:\"url\";s:64:\"http://localhost/seac/wp-content/uploads/2019/06/44032347_xl.png\";s:2:\"id\";s:2:\"43\";s:6:\"height\";s:4:\"1216\";s:5:\"width\";s:4:\"1218\";s:9:\"thumbnail\";s:72:\"http://localhost/seac/wp-content/uploads/2019/06/44032347_xl-150x150.png\";s:5:\"title\";s:11:\"44032347_xl\";s:7:\"captio