(36, 1, '2019-06-26 04:44:39', '2019-06-26 04:44:39', '<!-- wp:paragraph -->\n<p>This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:</p>\n<!-- /wp:paragraph -->\n<!-- wp:quote -->\n<blockquote><p>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pia coladas. (And gettin\' caught in the rain.)</p></blockquote>\n<!-- /wp:quote -->\n<!-- wp:paragraph -->\n<p>...or something like this:</p>\n<!-- /wp:paragraph -->\n<!-- wp:quote -->\n<blockquote><p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</p></blockquote>\n<!-- /wp:quote -->\n<!-- wp:paragraph -->\n<p>As a new WordPress user, you should go to <a href=\"http://localhost/seac/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>\n<!-- /wp:paragraph -->		\n			<h2>Contextualized Solutions(CS)</h2>		\n		<p>Leading innovation by design. Driving performance by execution.</p>', 'Home', '', 'inherit', 'closed', 'closed', '', '2-autosave-v1', '', '', '2019-06-26 04:55:10', '2019-06-26 04:55:10', '', 2, 'http://localhost/seac/2019/06/26/2-autosave-v1/', 0, 'revision', '', 0),
